import React from 'react';
import ContentLoader from 'react-content-loader';

const Skeleton = (props) => (
  <ContentLoader
    speed={2}
    width={280}
    height={476}
    viewBox="0 0 280 476"
    backgroundColor="#f3f3f3"
    foregroundColor="#ecebeb"
    {...props}>
    <circle cx="140" cy="140" r="120" />
    <rect x="0" y="280" rx="4" ry="4" width="280" height="24" />
    <rect x="0" y="324" rx="10" ry="10" width="280" height="84" />
    <rect x="144" y="428" rx="22" ry="22" width="133" height="44" />
    <rect x="0" y="436" rx="4" ry="4" width="98" height="27" />
  </ContentLoader>
);

export default Skeleton;
